import React from 'react';
import styled from 'styled-components';
import ListGroup from 'react-bootstrap';

const Styles=styled.div`
	 width: 700px ;
  margin-left: auto ;
  margin-right: auto ;
	.para{
		background:rgba(170, 14, 14, 0.59);
		padding:22px;
		text-align:center;
		font:2em 'Lobster';
	}
`
function Contact() {
	return(
		<Styles>
		<h2 className='title'>Let’s Be Friends!</h2>
		<p className='para'>
			I love connecting with people and building real communities with real human beings. So, if you have room for one more friend, here’s where you can find me…
			<ListGroup variant="flush">
			  <ListGroup.Item>Github</ListGroup.Item>
			  <ListGroup.Item>LinkedIn</ListGroup.Item>
			  <ListGroup.Item>StackOverflow</ListGroup.Item>
			  <ListGroup.Item>Twitter</ListGroup.Item>
			</ListGroup>
		</p>
		</Styles>

		);
}

export default Contact;
